import { Link } from "react-router-dom";

function SubHeaderPage() {
  return (
    <ul>
      <li>
        <Link>Job Preview</Link>
      </li>
      <li>
        <Link>Applicants</Link>
      </li>
      <li>
        <Link>Match</Link>
      </li>
      <li></li>
      <Link>Messages</Link>
    </ul>
  );
}

export default SubHeaderPage;
